.css-spinner {
  svg {
    width: 200px;
    height: 200px;
  }

  @keyframes spin {
    to {
      transform: rotate(360deg);
    }
  }

  .spin {
    transform-origin: center;
    animation: spin 2s linear infinite;
  }


  @keyframes progress {
    from {
      stroke-dasharray: 0 1400;
    }

    to {
      stroke-dasharray: 1257 1400;
    }
  }

  .progress {
    animation: progress 2s linear infinite;
    animation-direction: alternate;
  }


  @keyframes spin {
    to {
      transform: rotate(360deg);
    }
  }

  @keyframes spin2 {
    0% {
      stroke-dasharray: 1, 800;
      stroke-dashoffset: 0;
    }

    50% {
      stroke-dasharray: 400, 400;
      stroke-dashoffset: -200px;
    }

    100% {
      stroke-dasharray: 800, 1;
      stroke-dashoffset: -800px;
    }
  }

  .spin2 {
    transform-origin: center;
    animation: spin2 1.5s ease-in-out infinite,
      spin 2s linear infinite;
    animation-direction: alternate;
  }
}

.css-table {
  background-color: white;
  color: black;
  padding: 10px;

  a {
    color: blue;
  }

  * {
    box-sizing: border-box;
  }

  .wrapper {
    // overflow: scroll;
  }

  table {
    border-collapse: collapse;
    // width: max(65rem, 100%);
    table-layout: fixed;
  }

  th,
  caption {
    text-align: start;
  }

  caption {
    margin-block: 0.75rem;
  }

  thead th:not(:first-child),
  td {
    text-align: end;
  }

  thead {
    border-block-end: 2px solid;
    background: whitesmoke;
  }

  tfoot {
    border-block: 2px solid;
    background: whitesmoke;
  }

  th,
  td {
    border: 1px solid lightgrey;
    padding: 0.25rem 0.75rem;
    vertical-align: baseline;
  }

  th:first-child {
    position: sticky;
    inset-inline-start: 0;
    border-inline-end: none;
  }

  tbody th {
    background: white;
  }

  thead th,
  tfoot th {
    background: whitesmoke;
  }

  thead th {
    vertical-align: bottom;
  }

  td:first-of-type,
  :where(thead, tfoot) th:nth-child(2) {
    border-inline-start: none;
  }

  th:first-of-type {
    width: 10rem;
  }

  th:first-child::after {
    content: '';
    position: absolute;
    inset-block-start: 0;
    inset-inline-end: 0;
    width: 1px;
    height: 100%;
    background: lightgrey;
  }

  /* For the shadow: https://adrianroselli.com/2020/01/fixed-table-headers.html */
  div[tabindex="0"][aria-labelledby][role="region"] {
    background:
      linear-gradient(to right, transparent 30%, rgba(255, 255, 255, 0)),
      linear-gradient(to right, rgba(255, 255, 255, 0), white 70%) 0 100%,
      radial-gradient(farthest-side at 0% 50%, rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0)),
      radial-gradient(farthest-side at 100% 50%, rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0)) 0 100%;
    background-repeat: no-repeat;
    background-color: #fff;
    background-size: 4em 100%, 4em 100%, 1.4em 100%, 1.4em 100%;
    background-position: 0 0, 100%, 0 0, 100%;
    background-attachment: local, local, scroll, scroll;
  }
}

.css-checkbox {
  .custom-checkbox input[type="checkbox"]+label::before {
    text-align: center;
    content: '\a0';
    /* 不换行空格 */
    display: inline-block;
    vertical-align: .2em;
    width: .8em;
    height: .8em;
    margin-right: .2em;
    border-radius: .2em;
    background: silver;
    text-indent: .15em;
    line-height: .65;
  }

  .custom-checkbox input[type="checkbox"]:checked+label::before {
    content: '\2713';
    background: yellowgreen;
  }

  .custom-checkbox input[type="checkbox"] {
    position: absolute;
    clip: rect(0, 0, 0, 0);
  }

  .custom-checkbox input[type="checkbox"]:focus+label::before {
    box-shadow: 0 0 .1em .1em #58a;
  }

  .custom-checkbox input[type="checkbox"]:disabled+label::before {
    background: gray;
    box-shadow: none;
    color: #555;
    cursor: not-allowed;
  }

  .toggle-btn input[type="checkbox"] {
    position: absolute;
    clip: rect(0, 0, 0, 0);
  }

  .toggle-btn input[type="checkbox"]+label {
    display: inline-block;
    padding: .3em .5em;
    background: #ccc;
    background-image: linear-gradient(#ddd, #bbb);
    border: 1px solid rgba(0, 0, 0, .2);
    border-radius: .3em;
    box-shadow: 0 1px white inset;
    text-align: center;
    text-shadow: 0 1px 1px white;
  }

  .toggle-btn input[type="checkbox"]:checked+label,
  .toggle-btn input[type="checkbox"]:active+label {
    box-shadow: .05em .1em .2em rgba(0, 0, 0, .6) inset;
    border-color: rgba(0, 0, 0, .3);
    background: #bbb;
  }

  ul {
    overflow: auto;
    width: 10em;
    height: 8em;
    padding: .3em .5em;
    border: 1px solid silver;
    background: linear-gradient(white 30%, transparent),
      radial-gradient(at 50% 0, rgba(255, 0, 0, .8),
        transparent 70%);
    background-repeat: no-repeat;
    background-size: 100% 50px, 100% 15px;
    background-attachment: local, scroll;
  }
}

